import {
    Component
} from 'react'; //we need it for using Class
import logo from './logo.svg';
import './App.css';

class App extends Component {
    render() {
        return ( <
            div className = "App" >
            <
            header className = "App-header" >
            <
            img src = { logo }
            className = "App-logo"
            alt = "logo"/>



            </header > <
            /div>
        )
    }
}



